if ( ! function_exists( 'pawfriends_mikado_loading_spinners' ) ) {
	function pawfriends_mikado_loading_spinners() {
		$id           = pawfriends_mikado_get_page_id();
		$spinner_type = pawfriends_mikado_get_meta_field_intersect( 'smooth_pt_spinner_type', $id );
		
		$spinner_html = '';
		if ( ! empty( $spinner_type ) ) {
			switch ( $spinner_type ) {
				case 'pawfriends_spinner':
					$spinner_html = pawfriends_mikado_loading_spinner_pawfriends_spinner();
					break;
				case 'rotate_circles':
					$spinner_html = pawfriends_mikado_loading_spinner_rotate_circles();
					break;
				case 'pulse':
					$spinner_html = pawfriends_mikado_loading_spinner_pulse();
					break;
				case 'double_pulse':
					$spinner_html = pawfriends_mikado_loading_spinner_double_pulse();
					break;
				case 'cube':
					$spinner_html = pawfriends_mikado_loading_spinner_cube();
					break;
				case 'rotating_cubes':
					$spinner_html = pawfriends_mikado_loading_spinner_rotating_cubes();
					break;
				case 'stripes':
					$spinner_html = pawfriends_mikado_loading_spinner_stripes();
					break;
				case 'wave':
					$spinner_html = pawfriends_mikado_loading_spinner_wave();
					break;
				case 'two_rotating_circles':
					$spinner_html = pawfriends_mikado_loading_spinner_two_rotating_circles();
					break;
				case 'five_rotating_circles':
					$spinner_html = pawfriends_mikado_loading_spinner_five_rotating_circles();
					break;
				case 'atom':
					$spinner_html = pawfriends_mikado_loading_spinner_atom();
					break;
				case 'clock':
					$spinner_html = pawfriends_mikado_loading_spinner_clock();
					break;
				case 'mitosis':
					$spinner_html = pawfriends_mikado_loading_spinner_mitosis();
					break;
				case 'lines':
					$spinner_html = pawfriends_mikado_loading_spinner_lines();
					break;
				case 'fussion':
					$spinner_html = pawfriends_mikado_loading_spinner_fussion();
					break;
				case 'wave_circles':
					$spinner_html = pawfriends_mikado_loading_spinner_wave_circles();
					break;
				case 'pulse_circles':
					$spinner_html = pawfriends_mikado_loading_spinner_pulse_circles();
					break;
				default:
					$spinner_html = pawfriends_mikado_loading_spinner_pulse();
			}
		}

		print pawfriends_mikado_get_module_part($spinner_html);
	}
}

